import React from 'react';
import styled from 'styled-components';
import {
	orderAndSupport,
	Services,
	locatioPreferences,
	sustainability,
	about,
	socialMedia,
} from './footerData';
import PrintFooterData from './PrintFooterData';

function Footer() {
	return (
		<Wrapper>
			<Email>
				<input type='text' placeholder='E-mail'></input>
				<div>
					<input type='checkbox' id='scales' name='scales' />
					<label for='scales'>
						Subscribe to receive communications from Aesop about our
						products and services. By subscribing, you confirm you have
						read and accept our privacy <span>policy</span>
					</label>
				</div>
			</Email>
			<PrintFooterData
				title={orderAndSupport.title}
				data={orderAndSupport.data}
			/>
			;
		</Wrapper>
	);
}

export default Footer;

const Wrapper = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	flex-wrap: wrap;
`;

